import React from 'react';
import { CssBaseline,AppBar,Toolbar,Typography,Stack,Box} from '@mui/material';
import {NotificationsOutlined,ChatBubbleOutlineOutlined,CalendarTodayOutlined} from '@mui/icons-material';
import { createTheme, ThemeProvider } from '@mui/material/styles';
const theme = createTheme();

theme.typography.h3 = {
  fontSize: '1.2rem',

  [theme.breakpoints.up('md')]: {
    fontSize: '2rem',
    backgroundColor:"#ffffff"
  },
};

const Heeder = () => {
    return (
        <>
            <CssBaseline />
      <AppBar position="relative">
        <Toolbar  sx={{bgcolor:"#0d0d0d",height:100,display:"flex",justifyContent:"space-between"}}>

          <Stack sx={{p:4}} >
        <Typography variant="h4" color="inherit" noWrap>
            BRIDAL CONCEPT
          </Typography>
          <Typography variant="h6" align="center" color="inherit">
            HAUTE COUTURE

          </Typography>
        </Stack>

<Stack sx={{p:5}} direction="row">


<ThemeProvider theme={theme}>
    <Box>

    <NotificationsOutlined  sx={{ml:2,mr:2,color:"#000000"}} />
    </Box>
</ThemeProvider>

<Box> <ChatBubbleOutlineOutlined sx={{ml:2,mr:2,color:"#000000"}}/></Box>
<Box> <CalendarTodayOutlined sx={{ml:2,mr:2,color:"#000000"}}/></Box>



</Stack>





        </Toolbar>
      </AppBar>
        </>
    )
}

export default Heeder;
